int WhiteTableStates[4] = {S_MakeUpW, S_MakeUp, S_TermW, S_EOL};    


struct proto *BlackTables[4] = {MakeUpB, MakeUp, TermB, EOLH};    
int BlackTableStates[4] = {S_MakeUpB, S_MakeUp, S_TermB, S_EOL};    

TIFFFaxTabEnt	*GetSingleFaxTabEntry(uint16 BitsSeq, int BitsSeqWidth)
{ int *pTableStates;
  struct proto **pT;
	int NumOfTable;
	int limit = 1 << BitsSeqWidth;	
	TIFFFaxTabEnt *E = &SingleFaxTabEntry;	
	
	if (BitsSeqWidth==12)
	{
		//whight
		pTableStates=WhiteTableStates;
		pT = WhiteTables;
	}
	else if (BitsSeqWidth==13){
		//black
		pTableStates=BlackTableStates;
		pT = BlackTables;
	}
	else 		
		goto return_result;
		
	
	E->State = 0;
	E->Width = 0;
	E->Param = 0;		
	for(NumOfTable=0; NumOfTable<4; NumOfTable++)
	{
		struct proto *P = *pT;
    	while (P->val) 
		{
			int width = P->val & 0x0F;
			int param = P->val >> 4;
			int incr = 1 << width;
			int code;
			for (code = P->code; code < limit; code += incr) 
			{
				if (code==BitsSeq)
				{
	    			E->State = *(pTableStates + NumOfTable);
	    			E->Width = width;
	    			E->Param = param;
					goto return_result;
				}
			}
		P++;
    	}
    	pT++;
	}		
return_result:	
	return E; 
}
